import React, {useEffect, useState} from "react";
import styles from "./ShowContainer.module.scss";
import {getContainer} from "../../utils/api";
import {useRouter} from "next/router";

const initialState = {
  container: "",
};

export function ShowContainer() {
  const [state, setState] = useState(initialState);
  const router = useRouter();
  const id = router.query.bookContainer;

  useEffect(() => {
    async function fetch() {
      try {
        if (id) {
          const response = await getContainer(id);
          console.log(response.data);
          if (response.data) {
            setState({...state, container: response.data});
          }
        }
      } catch (error) {
        console.log(error);
      }
    }
    fetch();
  }, [id]);

  return (
    <div className={styles.wrapper}>
      <div className={styles.headerBox}>
        <h1 className={styles.h1}>Hyr {state.container.type}</h1>
      </div>
      <div className={styles.ContainerSpecs}>
        <h4 className={styles.h4}>
          Din {state.container.type} finns p책 {state.container.location}
        </h4>
        <h4 className={styles.h4}>Pris per m책nad {state.container.price}:-</h4>
        <h4 className={styles.h4}>Storlek: {state.container.m2}kvm</h4>
        <h4 className={styles.h4}>
          Din {state.container.type} 채r m채rkt med nummer: {state.container.containerNumber}
        </h4>
      </div>
    </div>
  );
}
